import React, { useEffect } from "react";
import AOS from 'aos';
import 'aos/dist/aos.css'
import './Styles/Home.css'
function Home()
{
    useEffect(()=>{
        AOS.init({
            duration:2000,
        })
    },[])
    return(
        <div >
            <div id="carouselExampleControls" class="carousel slide" data-bs-ride="carousel">
 
  <p>Gallery</p>
  <div className="pic" data-aos="zoom-in-up">
    <img src="./images/v1.jpg" style={{height:"200px"}}></img>
  </div>
  <div className="pic" data-aos="zoom-in-up">
    <img src="./images/v2.jpg" style={{height:"200px"}}></img>
  </div>
  <div className="pic" data-aos="zoom-in-up">
    <img src="./images/v3.jpg" style={{height:"200px"}}></img>
  </div>
  <div className="pic" data-aos="zoom-in-up">
    <img src="./images/a.jpg" style={{height:"200px"}}></img>
  </div>
  <div className="pic" data-aos="zoom-in-up">
    <img src="./images/v5.jpg" style={{height:"200px"}}></img>
  </div>
  <div className="pic" data-aos="zoom-in-up">
    <img src="./images/v7.jpg" style={{height:"200px"}}></img>
  </div> 

</div>

 


</div>

         
    )
}
export default Home;
